import {motion} from 'framer-motion'
const Place = () => {
    return (
    <motion.div
    initial={{opacity : 0}}
    animate={{opacity : 1}}
    exit={{opacity : 0}}
    className='container'
    >
            <div className='location'>
                <h1>Address :</h1>
                <p>Podili,<br/>
                   Ongole,<br/>
                   AndraPradesh,<br/>
                   India.<br/>
                </p>
            </div>
        </motion.div>
    )
}

export default Place
